import React from 'react';
import { Link } from 'react-router-dom';

function Home() {
    return (
        <div className="p-5 mb-4 bg-light rounded-3">
            <div className="container-fluid py-5">
                <h1 className="display-5 fw-bold">Welcome to FitFlex</h1>
                <p className="col-md-8 fs-4">Your one-stop solution for managing and booking fitness classes. Browse our schedule and start your fitness journey today.</p>
                <Link className="btn btn-primary btn-lg" to="/classes">Browse Classes</Link>
            </div>
        </div>
    );
}

export default Home;
